import React, { useEffect, useState } from "react";
import axios from "axios";


function TeachersTab() {
  const [teachersdata, setTeachersData] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:5000/api/teachers", {
        headers: {
          "Access-Control-Allow-Origin": "*",
          "Access-Control-Allow-Methods": "GET,PUT,POST,DELETE,PATCH,OPTIONS",
        },
      })
      .then((response) => {
       //setTeachersData(response.data);
        console.log(response);
      });
  }, []);
  



  return (
    <div>
      <h1>teachers tab</h1>
      <p>{teachersdata[0].teacher_id}</p>
      <p>{teachersdata[0].teacher_name}</p>
      <p>{teachersdata[0].parent_contactno}</p>
      <p>{teachersdata[0].tentative_start_date}</p>
      <p>{teachersdata[1].teacher_id}</p>
      <p>{teachersdata[1].teacher_name}</p>
      <p>{teachersdata[1].parent_contactno}</p>
      <p>{teachersdata[1].tentative_start_date}</p>
    </div>
  );
}

export default TeachersTab;
